INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (7, 24, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", "2030/12/17 14:59:59", "エリコ", 100, 0.0, 10.85, 129901, 100, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", "2030/12/17 14:59:59", "エリコ", 101, 0.0, 11.15, 129901, 101, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (5, 24, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", "2030/12/17 14:59:59", "エリコ", 102, 0.0, 6.4, 129901, 102, 0.0, 10142, 7, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (3, 24, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", "2030/12/17 14:59:59", "エリコ", 103, 0.0, 0.0, 129901, 103, 0.0, 10142, 3, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (8, 24, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", "2030/12/17 14:59:59", "エリコ", 104, 0.0, 2.43, 129901, 104, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (3, 24, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", "2030/12/17 14:59:59", "エリコ", 105, 0.0, 9.08, 129901, 105, 0.0, 10142, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (6, 24, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", "2030/12/17 14:59:59", "エリコ", 106, 0.0, 0.0, 129901, 106, 0.0, 10142, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (8, 24, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", "2030/12/17 14:59:59", "エリコ", 107, 0.0, 10.6, 129901, 107, 0.0, 10142, 3, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (4, 24, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", "2030/12/17 14:59:59", "エリコ", 108, 0.0, 7.54, 129901, 108, 0.0, 10142, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (7, 24, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", "2030/12/17 14:59:59", "エリコ", 109, 0.0, 11.5, 129901, 109, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", "2030/12/17 14:59:59", "エリコ", 110, 0.0, 8.83, 129901, 110, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", "2030/12/17 14:59:59", "エリコ", 111, 0.0, 6.68, 129901, 111, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", "2030/12/17 14:59:59", "エリコ", 112, 0.0, 8.8, 129901, 112, 0.0, 10142, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", "2030/12/17 14:59:59", "エリコ", 113, 0.0, 8.9, 129901, 113, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (5, 24, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", "2030/12/17 14:59:59", "エリコ", 114, 0.0, 3.7, 129901, 114, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", "2030/12/17 14:59:59", "マコト", 200, 0.0, 7.6, 129801, 200, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", "2030/12/17 14:59:59", "マコト", 201, 0.0, 2.25, 129801, 201, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", "2030/12/17 14:59:59", "マコト", 202, 0.0, 3.28, 129801, 202, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", "2030/12/17 14:59:59", "マコト", 203, 0.0, 2.98, 129801, 203, 0.0, 10142, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", "2030/12/17 14:59:59", "マコト", 204, 0.0, 3.0, 129801, 204, 0.0, 10142, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", "2030/12/17 14:59:59", "マコト", 205, 0.0, 10.3, 129801, 205, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", "2030/12/17 14:59:59", "マコト", 206, 0.0, 2.93, 129801, 206, 0.0, 10142, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", "2030/12/17 14:59:59", "マコト", 207, 0.0, 9.3, 129801, 207, 0.0, 10142, 3, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", "2030/12/17 14:59:59", "マコト", 208, 0.0, 6.9, 129801, 208, 0.0, 10142, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", "2030/12/17 14:59:59", "マコト", 209, 0.0, 0.0, 129801, 209, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", "2030/12/17 14:59:59", "マコト", 210, 0.0, 5.95, 129801, 210, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", "2030/12/17 14:59:59", "マコト", 211, 0.0, 6.73, 129801, 211, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", "2030/12/17 14:59:59", "マコト", 212, 0.0, 0.0, 129801, 212, 0.0, 10142, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (2, 24, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", "2030/12/17 14:59:59", "マコト", 213, 0.0, 6.65, 129801, 213, 0.0, 10142, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_85e060c814bafa4536f9975f2aba1b2611adc4bd19451eaed8b9ba03450e831f` VALUES (1, 24, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", "2030/12/17 14:59:59", "マコト", 214, 0.0, 3.05, 129801, 214, 0.0, 10142, 6, "2024/03/31 12:00:00");
